import React, { Component } from "react";

class Button_Quick_view extends Component {
  render() {
    return (<a>

    
        <button
          type="button"
          className="btn btn-primary"
          data-toggle="modal"
        >
          Launch demo modal
        </button>
        </a>
    );
  }
}

export default Button_Quick_view;
